import React from "react";

export default function EditProfilePopup() {

  return(
    <PopupWithForm
      name="profile"
      title="Редактировать профиль"
      isOpen={isPopupProfileOpen}
      onClose={closeAllPopups}>
      <FormWithProfile/>
    </PopupWithForm>
  )
}
